import {Title} from './styleComps';
import styled from 'styled-components';
import {Link} from 'react-router-dom';

const Button = styled.button`
  display: inline-block;
  color: palevioletred;
  font-size: 1em;
  margin: 1em;
  padding: 0.25em 1em;
  border: 2px solid palevioletred;
  border-radius: 3px;
  display: block;
`;

const TomatoButton = styled(Button)`
  color: tomato;
  border-color: tomato;
`;

const reverse = props => (<Button {...props} children={props.children.replace(/\b\w/g, ($1) => $1.toUpperCase())}></Button>);

const LinkComp = styled(Link)`
    color: tomato;
    border: 1px solid tomato;
    padding: 2px 
`

function Home() {
    return (<>
        <Button as={reverse} href="/">link with button styles</Button>
        <TomatoButton as={reverse} href="/">link with tomato button styles</TomatoButton>
        <LinkComp>跳转</LinkComp>
    </>)
}

export default Home;
